import { useEffect, useState } from 'react';
import './App.css';

function App() {


  let [articles, setArticles] = useState([]);

  useEffect(()=>{
    fetch(`https://newsapi.org/v2/everything?q=Apple&from=2024-03-05&sortBy=popularity&apiKey=4cc92de37cc846599a565a4a78410de0`)
    .then((response)=>response.json())
    .then((news)=>{
      console.log(news.articles);
    })
    .catch((err)=>{
      console.log(err)
    })
  }, [])

  return (
    <div className="App">
      <h1>News App</h1>
    </div>
  );
}

export default App;
